  false,\n\t\"url\": null,\n\t\"notes\": \"Satellite tagging was implemented in 2013.
  Satellite tagging is conducted using a Dan Inject air rifle and deployment arrows
  designed by Wildlife Computers. Two types of tags are deployed. One type is a Wildlife
  Computers SPOT5-240C tag that collects location and temperature. The other tag type
  is the Wildlife Computers SPLASH10-292B, which provides location as well as depth,
  temperature, and light level.n\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
